import React from 'react'
import * as S from './styles'
import { AiOutlineHome } from "react-icons/ai";

const NavigationMenu = () => {
  return (
    <S.NavigationMenu>
      <S.MenuItem to="/">
        <S.IconWrapper>
            <AiOutlineHome />
          <S.Title>Home</S.Title>
        </S.IconWrapper>
      </S.MenuItem>

    </S.NavigationMenu>
  );
}

export {NavigationMenu}
